    {conName :'Africa', img:'imges/africa.jpg', id:'01' },
    {conName :'The Americas' , img:'imges/north-america.jpg', id:'02' },
    {conName :'Asia', img:'imges/asia.jpg', id:'03' },
    {conName :'Europe', img:'imges/Europe.jpg', id:'04' },
    {conName :'Oceania', img:'imges/Oceania.jpg', id:'05' }
  ]

  return(
    <div>
      {continents.map(con=>{
        return(
          <div className="card" key={con}>
            <img src={con.img} className="card-img-top" alt="card-img-top" width={'100px'}/>
            <div className="card-body">
                <h5 className="card-title text-danger">AFRICA</h5>
                     <button class="btn btn-outline-warning"><small className="text-muted">check lands</small></button>
            </div>
          </div>

        )
      })}
    </div>
  )
}

export default FiveContinents
